import React, {Component} from 'react';

class CircleArea extends Component {
    constructor (props) {
        super(props);
        props.sections = 6;
        props.centerX = 0;
        props.centerY = 0;
    }
    render() {
        return (
            <React.Fragment>
                <canvas id="spider-chart" width="300" height="300"></canvas>
            </React.Fragment>
        );
    }
}

export default CircleArea;
